import React, {useState, useEffect} from "react";
// import {
//  UsersCard
// } from "./pages/Users";


 const Users = () =>{
  
  const [data, setData] = React.useState({
    error: '',
    data: [],
    temp: [],
    error: null,
    search: null,
    

  });
  const [q, setQ] = useState("");

  const getData = async () => {
    const url = 'https://api.foodealzapi.com/users';
    let user;
    user = [];
    await fetch(url)
      .then(res => res.json())
      .then(res => {
        console.log(res)
        setData({
          ...data,
          data: res,
          temp: res,

        });
      })
      .catch(error => {
        setData({
          ...data,
          error: 'Error Loading content',
        })
      })
  };

  const searchFilterFunction = (text) => {
    const newData = data.temp.filter((item) => {
      const itemData = `${item.nom.toUpperCase()}`;
      const textData = text.toUpperCase();
      return itemData.indexOf(textData) > -1;
    });
    setData({
      ...data,
      data: newData
    })
  };
 const Title1 = {
  fontSize: '20px',
  color: '#008037',
  fontWeight: 'bold',
  justifyContent: 'center'
 }

 const Search1 = {
  
  backgroundColor: 'white',
   borderBottomWidth: 1,
    borderBottomColor: '#b4b4b4b4b4'
 }
 const item = { 
  fontSize: '12px',
  flexDirection: 'row',
  marginBottom: '10px',
   fontWeight: 'bold'
 }
return (
  <div>
      <div style={Title1}>
          <h2>Users</h2> 

      </div>
      <div style={Search1} >
      <input type="text" placeholder=" Search Here..." value={q} onChange={(e) => setQ(e.target.value)} />
      </div>
      <div style={item}>
        <h3> UserId</h3>
        <h3> UserFirstame</h3>
        <h3> UserLastname</h3>
        <h3> UserPassword</h3>
        <h3> UserMail</h3>
        <h3> Username</h3>
        <h3> UserVille</h3>
      </div>
     
  </div>
)
 }
export default Users;
